import { Link, NavLink } from "react-router-dom";
import "./Css/Navbar.css";

const Navbar = () => {
  const navigate = useNavigate();

  const handleNavigation = (path) => {
    navigate(`/${path}`);
  };

  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <a href="#hero">RS Associates</a>
      </div>
      <div className="nav-links">
        <a onClick={() => handleNavigation("")}>Home</a>
        <a onClick={() => handleNavigation("about")}>About</a>
        <a onClick={() => handleNavigation("services")}>Services</a>
        <a onClick={() => handleNavigation("gallery")}>Gallery</a>
        <a onClick={() => handleNavigation("contact")}>Contact</a>
        <a> <button  onClick={() => handleNavigation('joinus')}>Join Us</button>
        </a>
      </div>
    </nav>
  );
};

export default Navbar;
